import React, { useState, useEffect } from "react";
import "../styles/Home.css";
import { FaLinkedin, FaGithub, FaInstagram } from "react-icons/fa";
import { Link } from "react-router-dom";

const Home = () => {
  const [stockData, setStockData] = useState({
    symbol: "AAPL",
    price: "—",
    change: "—",
    changePercent: "—",
  });

  const [currencyData, setCurrencyData] = useState({
    base: "EUR",
    rates: { USD: "—", GBP: "—", PKR: "—" },
  });

  // ✅ Example users
  const [users] = useState([
    { id: 1, username: "talha", state: "active" },
    { id: 2, username: "ahmed", state: "inactive" },
    { id: 3, username: "fatima", state: "active" },
  ]);

  // ✅ Load/Stress
  const totalUsers = users.length;
  const activeUsers = users.filter((u) => u.state === "active").length;
  const load = totalUsers > 0 ? activeUsers / totalUsers : 0;
  const stress = load * 100;

  useEffect(() => {
    Promise.all([
      fetch("http://127.0.0.1:5000/api/stock").then((res) => res.json()),
      fetch("http://127.0.0.1:5000/api/currency").then((res) => res.json()),
    ])
      .then(([stockRes, currencyRes]) => {
        if (stockRes) setStockData(stockRes);

        if (currencyRes && currencyRes.rates) {
          setCurrencyData({
            base: currencyRes.base,
            rates: {
              USD: currencyRes.rates.USD,
              GBP: currencyRes.rates.GBP,
              PKR: currencyRes.rates.PKR,
            },
          });
        }
      })
      .catch((err) => console.error("Error fetching data:", err));
  }, []);

  return (
    <div className="home-container">
      {/* Hero Section */}
      <div className="hero">
        <div className="hero-left">
          <img
            src="https://via.placeholder.com/250x250.png?text=Profile+Photo"
            alt=""
            className="profile-img"
          />
        </div>

        <div className="hero-right">
          <h3>Hello, Myself</h3>
          <h1>M. Talha Faizan</h1>
          <h2>
            And I'm a{" "}
            <span className="highlight">Web Developer and ML Engineer</span>
          </h2>
          <p>
            I am a passionate Web Developer and have a keen interest in AI/ML
            Engineering. I love building creative and efficient solutions that
            bridge the gap between modern web technologies and intelligent
            systems. Always eager to learn and explore new challenges in the
            tech world.
          </p>

          {/* Social Icons + Login Button */}
          <div className="social-icons">
            <a
              href="https://www.linkedin.com/in/m-talha-faizan-46158532a/"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaLinkedin />
            </a>
            <a
              href="https://github.com/talha-xml"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaGithub />
            </a>
            <a
              href="https://www.instagram.com/not.mtf/"
              target="_blank"
              rel="noopener noreferrer"
            >
              <FaInstagram />
            </a>

            <Link to="/login" className="btn login-btn">
              Login
            </Link>
          </div>
        </div>
      </div>

      {/* API Dashboards */}
      <div className="dashboard-container">
        <div className="dashboard-section">
          <h2>Stock Market</h2>
          <div className="card">
            <p>
              <strong>Symbol:</strong> {stockData.symbol}
            </p>
            <p>
              <strong>Price:</strong> {stockData.price}
            </p>
            <p>
              <strong>Change:</strong> {stockData.change} (
              {stockData.changePercent})
            </p>
          </div>
        </div>

        <div className="dashboard-section">
          <h2>Currency Rates (Base: {currencyData.base})</h2>
          <div className="card">
            <p>
              <strong>USD:</strong> {currencyData.rates.USD}
            </p>
            <p>
              <strong>GBP:</strong> {currencyData.rates.GBP}
            </p>
            <p>
              <strong>PKR:</strong> {currencyData.rates.PKR}
            </p>
          </div>
        </div>
      </div>

      {/* ✅ Combined User + Load/Stress Dashboard */}
      <div className="table-container">
        <div className="card">
          <h2>User & System Dashboard</h2>

          {/* User Table */}
          <table className="user-table">
            <thead>
              <tr>
                <th>ID</th>
                <th>Username</th>
                <th>State</th>
              </tr>
            </thead>
            <tbody>
              {users.map((u) => (
                <tr key={u.id}>
                  <td>{u.id}</td>
                  <td>{u.username}</td>
                  <td>{u.state}</td>
                </tr>
              ))}
            </tbody>
          </table>

          {/* Load & Stress Table */}
          <table className="user-table" style={{ marginTop: "30px" }}>
            <thead>
              <tr>
                <th>Total Users</th>
                <th>Active Users</th>
                <th>Load</th>
                <th>Stress (%)</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{totalUsers}</td>
                <td>{activeUsers}</td>
                <td>{load.toFixed(2)}</td>
                <td>{stress.toFixed(0)}%</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Home;
